    state = {
        products: "",

    }

  render() {
    return (
      <div >
        <h1> {this.state.products[0]} </h1>

      </div>
    );
  }

  componentDidMount() {
    axios.get('http://206.189.198.100:8081/backend-0.0.1-SNAPSHOT/app/product')
      .then(res => {
        const products = res.data;
        console.log(products);
        this.setState({ products:products });
      })
  }

}

export default Product;
